import React from 'react'
import "./Sidenav.css"

function Sidenav() {
    return <div className='sidenav'>
        <img className='sidenav__logo' src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/27/CIS-A2K_Instagram_Icon_%28Black%29.svg/768px-CIS-A2K_Instagram_Icon_%28Black%29.svg.png" alt="" />
    </div>;
}

export default Sidenav
